@shinya321 If you're using "--mode=quantize" on the latest master commit of tensorflow, I found that there is a bug in the code that produces a KeyError at https://github.com/tensorflow/tensorflow/blob/9590c4c32dd4346ea5c35673336f5912c6072bf2/tensorflow/tools/quantization/quantize_graph.py#L490

That line should be changed from:
```
if self.already_visited[current_node.name]:
```
to:
```
if current_node.name in self.already_visited and self.already_visited[current_node.name]:
```
